        -- descComp Nуo vai ser preenchido
        -- localTrabDom Campos referentes nуo serуo preenchidos
        (SELECT horcontratual.jornadasemanal FROM (SELECT jornada.rh188_sequencial,count(*) *
            (SELECT split_part(((horatotal-horaintevalo))::varchar,\':\',1) AS duracao
               FROM
               (SELECT sum(CASE
                   WHEN rh189_tiporegistro = 4 THEN rh189_hora::interval
                   WHEN rh189_tiporegistro = 1 THEN rh189_hora::interval*-1
                   END) AS horatotal,
               sum(CASE
                   WHEN rh189_tiporegistro = 3 THEN rh189_hora::interval
                   WHEN rh189_tiporegistro = 2 THEN rh189_hora::interval*-1
                   END) AS horaintevalo
               FROM jornadahoras
               WHERE jornadahoras.rh189_jornada = jornada.rh188_sequencial) AS x)::integer AS jornadasemanal
            FROM gradeshorariosjornada 
            inner join jornada on jornada.rh188_sequencial = gradeshorariosjornada.rh191_jornada 
            JOIN gradeshorarios ON gradeshorariosjornada.rh191_gradehorarios = gradeshorarios.rh190_sequencial
            JOIN escalaservidor ON gradeshorarios.rh190_sequencial = escalaservidor.rh192_gradeshorarios
            WHERE escalaservidor.rh192_regist = rhpessoal.rh01_regist 
            AND escalaservidor.rh192_instit = fc_getsession(\'DB_instit\')::int
            AND jornada.rh188_tipo = \'T\'
            GROUP by jornada.rh188_sequencial) AS horcontratual) AS qtdHrsSem,
        -- tpJornada serс preenchido manualmente
        -- dscTpJorn serс preenchido manualmente
        -- tmpParc serс preenchido manualmente
        -- horario Preencher na hora de gerar as informaчѕes para envio (Ocultar na tela)
        rhsindicato.rh116_cnpj AS cnpjSindTrab
        -- nrProcJud serс preenchido manualmente
        -- observacao serс preenchido manualmente
        -- sucessaoVinc Nуo serуo preenchidos
        -- transfDom Nуo serуo preenchidos
        -- mudancaCPF serс preenchido manualmente
        -- afastamento Buscar na hora de enviar afastamentos que estejam na data de envio
        -- desligamento serс preenchido manualmente (observar necessidade conforme o layout)
        FROM cgm 
        JOIN rhpessoal ON cgm.z01_numcgm = rhpessoal.rh01_numcgm
        JOIN rhpesdoc ON rhpessoal.rh01_regist = rhpesdoc.rh16_regist
        JOIN rhpessoalmov ON rhpessoal.rh01_regist = rhpessoalmov.rh02_regist
        AND (rhpessoalmov.rh02_anousu,rhpessoalmov.rh02_mesusu) = (SELECT r11_anousu,r11_mesusu FROM cfpess ORDER BY r11_anousu DESC LIMIT 1)
        JOIN rhregime ON rhpessoalmov.rh02_codreg = rhregime.rh30_codreg
        JOIN rhsindicato ON rhpessoal.rh01_rhsindicato = rhsindicato.rh116_sequencial
        JOIN rhpesfgts ON rhpessoal.rh01_regist = rhpesfgts.rh15_regist
        JOIN tpcontra ON rhpessoalmov.rh02_tpcont = tpcontra.h13_codigo
        LEFT JOIN rhfuncao ON (rhpessoal.rh01_funcao, rhpessoal.rh01_instit) = (rhfuncao.rh37_funcao, rhfuncao.rh37_instit)
        LEFT JOIN rhpescargo ON (rhpescargo.rh20_seqpes, rhpescargo.rh20_instit) = (rhpessoalmov.rh02_seqpes, rhpessoalmov.rh02_instit)
        LEFT JOIN rhcargo ON (rhpescargo.rh20_cargo, rhpescargo.rh20_instit) = (rhcargo.rh04_codigo, rhcargo.rh04_instit)
        JOIN db_config ON rhpessoal.rh01_instit = db_config.codigo
        JOIN cgm localtrab ON db_config.numcgm = localtrab.z01_numcgm
        -- ENDERECO TRABALHADOR
        JOIN cgmendereco ON cgm.z01_numcgm = cgmendereco.z07_numcgm
        JOIN endereco ON cgmendereco.z07_endereco = endereco.db76_sequencial
        JOIN cadenderlocal ON endereco.db76_cadenderlocal = cadenderlocal.db75_sequencial
        JOIN cadenderbairrocadenderrua 
        ON cadenderlocal.db75_cadenderbairrocadenderrua = cadenderbairrocadenderrua.db87_sequencial
        JOIN cadenderbairro ON cadenderbairrocadenderrua.db87_cadenderbairro = cadenderbairro.db73_sequencial
        JOIN cadenderrua ON cadenderbairrocadenderrua.db87_cadenderrua = cadenderrua.db74_sequencial
        JOIN cadendermunicipio ON cadenderrua.db74_cadendermunicipio = cadendermunicipio.db72_sequencial
        INNER JOIN cadendermunicipiosistema ON cadendermunicipiosistema.db125_cadendermunicipio = cadendermunicipio.db72_sequencial
        AND cadendermunicipiosistema.db125_db_sistemaexterno = 4
        INNER JOIN cadenderestado ON cadendermunicipio.db72_cadenderestado = cadenderestado.db71_sequencial
        INNER JOIN cadenderpais ON cadenderestado.db71_cadenderpais = cadenderpais.db70_sequencial
        INNER JOIN cadenderpaissistema ON cadenderpais.db70_sequencial = cadenderpaissistema.db135_db_cadenderpais
        AND cadenderpaissistema.db135_db_sistemaexterno = 3
        JOIN cadenderruaruastipo ON cadenderrua.db74_sequencial = cadenderruaruastipo.db85_cadenderrua
        JOIN ruastipo ON cadenderruaruastipo.db85_ruastipo = ruastipo.j88_codigo
        -- FIM ENDERECO TRABALHADOR 
        WHERE db_config.codigo = fc_getsession(\'DB_instit\')::int', false);
